import 'package:firebase_auth/firebase_auth.dart';
import 'package:flutter/material.dart';

class DynamicList extends StatefulWidget {
  const DynamicList({super.key});

  @override
  State<DynamicList> createState() => _DynamicListState();
}

class _DynamicListState extends State<DynamicList> {

  var car = [
    {
      "brand" : "Toyota",
      "name" : "Corolla",
      "price" : 510000,
      "model" : "abc",
      "img" : "data:image/jpeg;base64,"
    },
    {
      "brand" : "Toyota",
      "name" : "Mark X",
      "price" : 610000,
      "model" : "xyz",
      "img" : "data:image/jpeg;base64,"
    },
    {
      "brand" : "Toyota",
      "name" : "Prius",
      "price" : 810000,
      "model" : "ijk",
      "img" : "data:image/jpeg;base64,"
    },
    {
      "brand" : "Toyota",
      "name" : "Landcruiser",
      "price" : 50000000,
      "model" : "Classic",
      "img" : "data:image/jpeg;base64,"
    },
  ];

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text("Dynamic List"),
        backgroundColor: Colors.black,
        foregroundColor: Colors.white,
        centerTitle: true,
        actions: [
          IconButton(onPressed: (){
            FirebaseAuth.instance.signOut();
            Navigator.pushNamed(context, '/signin');
          }, icon: Icon(Icons.logout))
        ],
      ),
      body: ListView.builder(
        itemCount: car.length,
        itemBuilder: (context, index){
         return Padding(
          padding: EdgeInsets.all(10),
          child: 
          ListTile(
            title: Text("${car[index]["brand"]}"),
            subtitle: Text("${car[index]["name"]} \n ${car[index]["price"]}"),
            leading: Image.network("${car[index]["img"]}",),
              trailing: Icon(Icons.card_travel),
          ),
          );
        }
        ),
    );
  }
}